import Lorem from 'react-lorem'
import './css/ElysianContentContent.css'

class ElysianContentContent extends Component{
    render(){
        return(
            <div className="ElysianContentContent">
                <Lorem/>
            </div>
        )
    }
}

export default ElysianContentContent
